if (process.env.NODE_ENV !== 'production') {
  require('dotenv').config();
}

const express = require('express');
const path = require('path');
const bcrypt = require('bcrypt');
const passport = require('passport');
const flash = require('express-flash');
const session = require('express-session');

const initializePassport = require('./passport-config');
const users = []; // Users array should be defined before calling initializePassport

initializePassport(
  passport, 
  email => users.find(user => user.email === email),
  id => users.find(user => user.id === id)
);

const app = express();
app.set('view engine', 'ejs'); // Corrected 'view-engine' to 'view engine'


// Static files middleware
app.use(express.static('./SWE363 Project/css'));
app.use(express.static('./SWE363 Project/fonts'));
app.use(express.static('./SWE363 Project/js')); // Changed 'JS' to 'js' for consistency
app.use(express.static('./SWE363 Project/images'));

// Commented out the HTML directory to prevent serving static HTML files
// app.use(express.static('./SWE363 Project/html'));

// Middleware
app.use(express.urlencoded({ extended: false }));
app.use(flash());
app.use(session({
  secret: process.env.SESSION_SECRET || 'secret',
  resave: false,
  saveUninitialized: false
}));
app.use(passport.initialize());
app.use(passport.session());

// Routes
// app.get('/', (req, res) => {
//   res.sendFile(path.resolve(__dirname, './views/index.ejs'));
// });

app.get('/', (req, res) => {
  res.render('index');
});

app.get('/register', checkNotAuthenticated, (req, res) => { 
  res.render('register');
});

app.post('/register', checkNotAuthenticated, async (req, res) => {
  try {
    const hashedPassword = await bcrypt.hash(req.body.password, 10);
    users.push({
      id: Date.now().toString(),
      name: req.body.name,
      email: req.body.email,
      password: hashedPassword
    });
    res.redirect('/login');
  } catch {
    res.redirect('/register');
  }
});

app.get('/login', checkNotAuthenticated, (req, res) => {
  res.render('login');
});

app.post('/login', checkNotAuthenticated, passport.authenticate('local', {
  successRedirect: '/',
  failureRedirect: '/login',
  failureFlash: true
}));

const covrg = {ceremonyTitle:"Ceremony honoring club presidents",details:"Short course in portrait photography by Mr. Mohammad Shabeb Don't miss this chance Note: \"your attend count with non academic activities\"",
photos:[
  "data:image/webp;base64,",
  "data:image/jpeg;base64,",
]}

covrg.ceremonyTitle
covrg.details
covrg.photos[0]

app.get('/covrege', (req,res) => {
  res.render('covrege', {covrg})
})

app.all('*', (req, res) => {
  res.status(404).send('Resource not found');
});

app.delete('/logout', (req, res) => {
  req.logOut()
  res.redirect('/login')
})

function checkAuthenticated(req, res, next) {
  if (req.isAuthenticated()) {
    return next()
  }

  res.redirect('/login')
}

function checkNotAuthenticated(req, res, next) {
  if (req.isAuthenticated()) {
    return res.redirect('/')
  }
  next()
}

app.listen(3000, () => {
  console.log('Server is listening on port http://localhost:3000 ...');
});
